class table extends HTMLElement {
  constructor() {
    super();
     this._token    ='';
     this._indexOn  ='';
     this._console  ='';
     this._stack    ='';
     this._id    ='';
     this._components  =new components();  
   
  }
  connectedCallback() {
     this._token    = this.getAttribute('token');
     this._indexOn  = this.getAttribute('indexOn');
     this._console  = this.getAttribute('console');
     this._stack    = this.getAttribute('stack');
     this._id       ='#'+this.getAttribute('id');
      if (this.getAttribute('import')) {
         var jsx = document.createElement("script");
         jsx.setAttribute("src", tatiyeNet.routes+'/modules/'+this.getAttribute('import'));
         jsx.setAttribute("type", "module");
         document.head.appendChild(jsx);
      }
         const getKeywords = document.querySelector(this._id +' tbody'); 
         var limit = getKeywords.getAttribute('key');
         var page = getKeywords.getAttribute('page');
         var keywords = getKeywords.getAttribute('keywords');
         if (keywords=='off') {

            var setkeywords='';
         } else {
            var setkeywords=keywords;
         }
     

     const app = new components();

      let myDb=useHandel({
               
               "token"    :this._token,
               "storage"       :{
                  "limit":limit,
                  "page":page,
                  "keywords":setkeywords
               }
            }) 

    return  app.tabel({
        "id"    :this.getAttribute('id'),
         "token"         :this._token,
         "setID"         :this._id,
         "useElement"    :this._id,
         "database"      :myDb,
      })

 }

}
customElements.define('app-table-tatiye', table);


