window.useClickObject=function(route,mainRoute,stc='/') {
         var segmenGet=route.split("/").splice(3,4).join("/");
         var heste=segmenGet.split('#');
         if (heste[1]) {
            var datahest=heste[0]+'/'+heste[1]
         } else {
            var datahest=segmenGet
         }
         var segmenMetaObj=route.split("/").splice(3,1).join("/");
         history.replaceState('setRhref', '', route);
         $.ajax({
                type: 'POST',
                 url: tatiyeNet.route,
                 data: 'package='+datahest+'&key=0'+'&base='+segmenMetaObj,
                 beforeSend: function() {
                   $(mainRoute).html(itemSpinner());    
                },
                success: function(data) {
                   $(mainRoute).html(data);
                   history.replaceState(null, null, '');
               }
           });
}




window.setNavigator=function(route,main='package') {
    var primaryKey=$(location).attr('href').split("/").splice(4,1).join("/").split('/');
  if (main=='package') {
    var redRoute='pec/'+primaryKey+'/'+route[0];
   } else {
    var redRoute='theme/'+primaryKey+'/'+route[0];

   }
  if (route[1]=='modal') {
    count++;
   var expoModelSegment=route[2].replace(/[^A-Za-z0-9]/g, '');
  
   var expoModel=route[2].replace(/[^A-Za-z0-9]/g, '')+count;
   
   if (route[3]) {
    var width=route[3];
   } else {
    var width='500px';
   }
   if (main=='package') {
    var redRoute='pec/'+primaryKey+'/'+route[0];
   } else {
    var redRoute='theme/'+primaryKey+'/'+route[0];

   }


   setModal({
           'titel':route[2],
           'width':width,
           'key'  :tatiyeNet.userid,
           'model':expoModel,
           'route':primaryKey,
           'tabel':'appuserprofil',
           'content':'fromAction',
           'element':'from',
           'page'   :1,
           'setdata' :'public',
          });

         if (expoModelSegment =='AppLogin') {
                   setFrom({
                             "storage"      :{
                               'label'    :false,
                               'tabel'    :'appuserprofil',
                               'segment'  :expoModelSegment,
                               'az'       :'a',
                               'reload'   :false,
                               'key'      :tatiyeNet.uid,
                               'model'    :expoModel,
                               'route'    :'profil',
                               'content'  :'from', 
                               'page'     :1,
                               'setdata'  :'public' //public,privacy 
                             },
                             "action"      :{
                                  'appLogin'     :['switch','6','Login','custom',
                                      ['Apps Qr Code','Standby','Standar','Serial Key','OTP'],
                                      ['Qr','Standby','Standar','Serial','Otp']
                                     
                                    ,true]
                              },
                    });
                    // ['Qr','Tandby','Standar','Google']
         } else {
            routePath(redRoute,'body'+expoModel,'modal')
         }
    } else {
      routePath(redRoute,route[1])
    }
}

